  false,\n\t\"url\": null,\n\t\"notes\": \"Sterna albifrons browni - life history
  requirements, populations, habitat, food, threats, and conservation measures are
  discussed to avoid the loss of the species. Endangered species. This recovery plan
  summarizes available biological information on the terns, identifies their environmental
  needs, and proposes orderly and comprehensive action to restore them to a viable
  population and ultimately, to delist the species from its endangered classification.
  September 1977, minor revisions September 1979, May 1980.\",\n\t\"license_title\":
